class MapArray extends Array {
  constructor(arr) {
    super();
    for (let i of arr) {
      this.push(i);
    }
  }
  get map() {
    const thisMap = new Map();
    let keys = Object.keys(this[0]);
    let anotherKey;
    for (let i of keys) {
      if (i !== "name") {
        anotherKey = i;
      }
    }

    for (let obj of this) {
      thisMap.set(obj.name, obj[anotherKey]);
    }
    return thisMap;
  }
}

